/*********************************** IMAGE LEVEL MOTION ESTIMATION *****************************************/
int doMotionEstimation(int* curr_frame, int* ref_frame, int macroblockCount, int Stride) 
{
	int*	currMB 			=	curr_frame;
	int*	refMB			=	ref_frame;
	int 	w_Stride		=	Stride/4;
	int mvx 				=	0;
	int mvy 				=	0;
	unsigned int	SAD 	=	0;
	unsigned int minSAD 	=	0xFFFFFFFF;
	int best_mvx			=	0;
	int best_mvy			=	0;
	unsigned int Satd		=	0;
	int i=0, j=0, c=0;
	int currentMB=0;
	
	//iterate over every Macroblock and the make some dummy operations;
	for(currentMB=0; currentMB<macroblockCount; currentMB++) 
	{
		c = c + SAD;
		refMB = (int*)((unsigned long)ref_frame+(mvy*Stride)+mvx);
		#if 0
		for(i=0;i<(67*16);i++)		//	16Calls per Candidate and total 67 Candidates (8HV+1Z+1T+3N+18-3LH+12-2SH+24-3SS)
		{
			SAD_16(refMB, w_stride, &SAD);
		}
		#endif
		
		// SAD_16...This one is for a complete MB.....
		for(i=0;i<67;i++)		//	1Calls per Candidate and total 67 Candidates (8HV+1Z+1T+3N+18-3LH+12-2SH+24-3SS)
		{
			SAD_16(currMB, refMB, w_Stride, &SAD);
			
			if(SAD<minSAD)
			{
				minSAD		=	SAD;
				best_mvx	=	mvx;
				best_mvy	=	mvy;
				//best_mvx	=	mvx<<2; 	//Convert into Quater Pel Resolution ... TODO Later when MC is fully supported
				//best_mvy	=	mvy<<2; 	//Convert into Quater Pel Resolution ... TODO Later when MC is fully supported
			}
		}
		for(i=0;i<16;i++)		//	16Calls per Candidate and total 16 Candidates (8-Half_Pel + 8-Quarter_Pel)
		{
			for(j=0;j<16;j++)		//	16Calls per Candidate and total 16 Candidates (8-Half_Pel + 8-Quarter_Pel)
			{
			
				Satd += SATD_4x4(currMB, w_Stride, refMB);
				//	May be Bilinear Comes here later..If I will get time Otherwise for future
			}
			if(Satd<minSAD)
			{
				minSAD		=	Satd;
				best_mvx	=	mvx;
				best_mvy	=	mvy;
			}
			Satd=0;
		}
		SAD_Array[currentMB] = minSAD;
	}

	return c;
}




int doEncodeMB_new(int* curr_frame, int* ref_frame, int Stride, const int imageNumber, const int numberOfMBs) 
{
	int currentMB, i, j, dummy;
	int currMB[16];
	int refMB[16];
	int* refMB1;
	
	int Pred_H[16];
	int DC_H = 0;
	int DC_V = 0;
	int dest_MCH = 0;
	int shift = 1;
	int retVal = 0;
	int w_stride = (396/4);
	int src0				=	0x00FF00FF;
	int src1				=	0x00FF00FF;
	int* DCT_ptr			=	DCT_start;
	int* HT_ptr 			=	HT_start;
	int* Cand_ptr		= (int*)Candidate;
	int mvx 				=	0;
	int mvy 				=	0;
	int best_mvx			=	0;
	int best_mvy			=	0;
	unsigned int	SAD 	=	0;
	unsigned int Satd		=	0;
	unsigned int minSAD 	=	0xFFFFFFFF;

	
	for (currentMB=0; currentMB < numberOfMBs; currentMB++) 
	{
		// MC, IPRED, DCT, HT
		// P-MB PROCESSING
		if(MB_Type[imageNumber][currentMB]==1)
		{
			for(i=0;i<(64+32);i++)									//	64 for Y, 32 for UV...Per MB
			{
				MC_Hz_4(refMB, shift, &dest_MCH);
			}
			for(j=0;j<2;j++)										// To simulate the both forward and Inverse paths
			{
				for(i=0;i<16;i++)									//	16 Calls for Y per MB
				{
					DCT_4x4(currMB, w_stride, refMB, DCT_ptr);		//	Calculating 16 4x4 Transforms per MB
				}
				for(i=0;i<8;i++)									//	8 Calls for UV per MB
				{
					DCT_4x4(currMB, w_stride, refMB, DCT_ptr);		//	Calculating 16 4x4 Transforms per MB
				}
				for(i=0;i<(2*4);i++)								//	U and V...and 4 4x4 block in 1 8x8 Block
				{
					di = HT_2x2_Chroma(src0, src1);
				}
			}
		}
		else
		{
			// I-MB PROCESSING
			for(i=0;i<(4+4);i++)									//	Four Modes for Intra Y and four for UV(4 of 16 as chroma is half and there are 2 components) Prediction
			{
				IPred_HDC_16x16(refMB, 1, &DC_H, Pred_H);
				IPred_VDC_16x16(refMB, 1, &DC_V);
			}
			for(j=0;j<2;j++)										// To simulate the both forward and Inverse paths
			{
				for(i=0;i<16;i++)									//	16 Calls for Y per MB
				{
					DCT_4x4(currMB, w_stride, refMB, DCT_ptr);		//	Calculating 16 4x4 Transforms per MB
				}
				for(i=0;i<8;i++)									//	8 Calls for UV per MB
				{
					DCT_4x4(currMB, w_stride, refMB, DCT_ptr);		//	Calculating 16 4x4 Transforms per MB
				}
				HT_4x4_IntraLuma(DCT_ptr, HT_ptr);				//	1 Transform for Intra
				for(i=0;i<(2*4);i++)								//	U and V...and 4 4x4 block in 1 8x8 Block
				{
					di = HT_2x2_Chroma(src0, src1);
				}
			}
		}
	}
	
  return retVal;
}



int doLoopFilter(int imageNumber, int macroblockCount) 
{
	int i=0, j=0, c=0;

	//iterate over every Macroblock and the make some dummy operations;
	for(i=0; i<macroblockCount; i++) 
	{
		for(j=0; j<32; j++) 
		{
			c = c + j;
			LoopFilter(0, 1, 0);
		}
	}

	return c;
}


